
/**
 * 双指针
 * 超长的字符串会超时
 */
var isAnagram = function (s, t) {
    if (s.length != t.length) return false
    let sArr = s.split('')
    let tArr = t.split('')

    for (let i = 0; i < sArr.length; i++) {
        let isMatch = false
        for (let j = 0; j < tArr.length; j++) {
            if (sArr[i] == tArr[j]) {
                isMatch = true
                delete tArr[j]
                break
            }
        }
        tArr = tArr.filter(e => e)
        console.log(tArr.length)
        if (!isMatch) return false
    }
    return true
};


/**
 * - 96ms
 * - 48.3.mb
 * 偷懒算法，通过sort来完成了大量的工作
 */
var isAnagram = function (s, t) {
    if (s.length != t.length) return false
    let sArr = s.split('').sort().join('')
    let tArr = t.split('').sort().join('')
    return sArr == tArr
};






